import React from 'react';

import styles from './UserForm.module.css'

const UserForm = () => {
  return <form className={styles['user-form']}>
      <div className="group">
        <label htmlFor="username">Username</label>
        <input type="text" name="username-input" id="usernameInput" />
      </div>
      <div className="group">
        <label htmlFor="age">Age (Years)</label>
        <input type="text" name="age-input" id="ageInput" />
      </div>
  </form>;
};

export default UserForm;
